DROP Database IF EXISTS mydb ;
-- -----------------------------------------------------
-- Schema mydb
-- -----------------------------------------------------
CREATE DATABASE mydb;
USE mydb ;

-- -----------------------------------------------------
-- Table DimDate
-- -----------------------------------------------------
DROP TABLE IF EXISTS DimDate ;


CREATE TABLE DimDate (
  DateId INT NOT NULL,
  Date DATETIME NULL,
  FullDateUK CHAR(10) NULL ,-- 'Date in dd-MM-yyyy format\n',
  FullDateUSA CHAR(10) NULL ,-- 'Date in MM-dd-yyyy format',
  DayOfMonth VARCHAR(2) NULL ,-- 'Field will hold day number of Month\n',
  DaySuffix VARCHAR(2) NULL ,-- 'Apply suffix as 1st, 2nd ,3rd etc\n',
  DayName VARCHAR(9) NULL ,-- 'Contains name of the day, Sunday, Monday \n',
  DayOfWeekUK CHAR(1) NULL ,-- 'First Day Sunday=1 and Saturday=7\n',
  DayofWeekUSA CHAR(1) NULL ,-- 'First Day Monday=1 and Sunday=7\n',
  DayOfWeekInMonth VARCHAR(2) NULL ,-- '1st Monday or 2nd Monday in Month\n',
  DayOfWeekInYear VARCHAR(2) NULL,
  DayOfYear VARCHAR(3) NULL,
  WeekOfMonth VARCHAR(1) NULL ,-- 'Week Number of Month \n',
  WeekOfYear VARCHAR(2) NULL ,-- 'Week Number of the Year\n',
  Month VARCHAR(2) NULL ,-- 'Number of the Month 1 to 12\n',
  MonthName VARCHAR(9) NULL ,-- 'January, February etc\n',
  Year CHAR(4) NULL ,-- 'Year value of Date stored in Row\n',
  MonthYear CHAR(10) NULL ,-- 'Jan-2013,Feb-2013\n',
  MMYYYY CHAR(6) NULL,
  FirstDayOfMonth DATE NULL,
  LastDayOfMonth DATE NULL,
  FirstDayOfYear DATE NULL,
  LastDayOfYear DATE NULL,
  IsHolidayUSA BIT NULL ,-- 'Flag 1=National Holiday, 0-No National Holiday\n',
  IsWeekday BIT NULL ,-- '0=Week End ,1=Week Day\n',
  HolidayUSA VARCHAR(64) NULL ,-- 'Name of Holiday in US\n',
  IsHolidayUK BIT NULL DEFAULT NULL ,-- 'Flag 1=National Holiday, 0-No National Holiday\n',
  HolidayUK VARCHAR(64) NULL DEFAULT NULL,
  PRIMARY KEY (DateId))
-- = 'Table Schema source: https://www.codeproject.com/Articles/647950/Create-and-Populate-Date-Dimension-for-Data-Wareho\n';



-- -----------------------------------------------------
-- Table DimProduct
-- -----------------------------------------------------
DROP TABLE IF EXISTS DimProduct ;


CREATE TABLE DimProduct (
  ProductId INT NOT NULL,
  ProductName VARCHAR(60) NULL,
  ProductCostCents INT NULL,
  Hight FLOAT NULL,
  Width FLOAT NULL,
  Length FLOAT NULL,
  Weight INT NULL,
  Reams INT NULL,
  ISPS VARCHAR(45) NULL,
  Color VARCHAR(45) NULL,
  Style VARCHAR(45) NULL,
  PRIMARY KEY (ProductId))




-- -----------------------------------------------------
-- Table DimEmployee
-- -----------------------------------------------------
DROP TABLE IF EXISTS DimEmployee ;


CREATE TABLE DimEmployee (
  EmployeeId INT NOT NULL,
  FirstName VARCHAR(45) NOT NULL,
  LastName VARCHAR(45) NOT NULL,
  MiddleName VARCHAR(45) NULL,
  Title VARCHAR(45) NULL,
  HireDate DATE NULL,
  BirthDate DATE NULL,
  LoginID VARCHAR(95) NULL,
  DepartmentName VARCHAR(45) NULL,
  EmailAddress VARCHAR(50) NULL,
  Phone VARCHAR(45) NULL,
  Gender CHAR(1) NULL,
  BaseRate INT NULL ,-- 'Rate/Hour',
  EmploymentStatus VARCHAR(45) NULL,
  PRIMARY KEY (EmployeeId))



-- -----------------------------------------------------
-- Table DimWarehouse
-- -----------------------------------------------------
DROP TABLE IF EXISTS DimWarehouse ;


CREATE TABLE DimWarehouse (
  WarehouseId INT NOT NULL,
  WarehouseName VARCHAR(45) NULL,
  PRIMARY KEY (WarehouseId))




-- -----------------------------------------------------
-- Table DimCustomer
-- -----------------------------------------------------
DROP TABLE IF EXISTS DimCustomer ;


CREATE TABLE DimCustomer (
  CustomerId INT NOT NULL,
  Title VARCHAR(8) NULL,
  FirstName VARCHAR(50) NULL,
  MiddleInitial VARCHAR(1) NULL,
  LastName VARCHAR(50) NULL,
  BirthDate DATE NULL,
  Gender CHAR(1) NULL,
  Email VARCHAR(45) NULL,
  Address VARCHAR(200) NULL,
  Phone VARCHAR(45) NULL,
  PRIMARY KEY (CustomerId))




-- -----------------------------------------------------
-- Table DimCurrency
-- -----------------------------------------------------
DROP TABLE IF EXISTS DimCurrency ;


CREATE TABLE DimCurrency (
  CurrencyId INT NOT NULL,
  CurrencyName VARCHAR(200) NULL,
  CurrencyShort VARCHAR(5) NULL,
  PRIMARY KEY (CurrencyId))




-- -----------------------------------------------------
-- Table DimGeography
-- -----------------------------------------------------
DROP TABLE IF EXISTS DimGeography ;


CREATE TABLE  DimGeography (
  GeographyId INT NOT NULL,
  City VARCHAR(45) NULL,
  StateProvinceCode VARCHAR(45) NULL,
  StateProvinceName VARCHAR(45) NULL,
  CountryRegionCode VARCHAR(45) NULL,
  EnglishCountryRegionName VARCHAR(45) NULL,
  PostalCode VARCHAR(15) NULL,
  PRIMARY KEY (GeographyId))




-- -----------------------------------------------------
-- Table FactOrderFulfilment
-- -----------------------------------------------------
DROP TABLE IF EXISTS FactOrderFulfilment ;


CREATE TABLE FactOrderFulfilment (
  OrderId INT NOT NULL,
  OrderDate INT NULL,
  CustomerKey INT NULL,
  ProductKey INT NULL,
  FulfilmentDate INT NULL,
  FulfillingEmployee INT NULL,
  RefundDate INT NULL,
  RefundingEmployee INT NULL,
  WarehouseKey INT NULL,
  CurrencyKey INT NULL,
  GeographyKey INT NULL,
  Quantity INT NULL,
  TotalPriceAUD FLOAT NULL ,-- 'Total amount in order',
  PRIMARY KEY (OrderId))




-- -----------------------------------------------------
-- Table FactPurchases
-- -----------------------------------------------------
DROP TABLE IF EXISTS FactPurchases ;


CREATE TABLE FactPurchases (
  PurchasesID INT NOT NULL,
  PurchaseDate INT NULL,
  ProductID INT NULL,
  WarehouseID INT NULL,
  Quantity INT NULL,
  PRIMARY KEY (PurchasesID))


-- -----------------------------------------------------
-- Table FactStockLevels
-- -----------------------------------------------------
DROP TABLE IF EXISTS FactStockLevels ;


CREATE TABLE FactStockLevels (
  StockLevelID INT NOT NULL,
  DateID INT NULL,
  ProductID INT NULL,
  WarehouseID INT NULL,
  StockLevel INT NULL)




-- -----------------------------------------------------
-- Table FactExchangeRateEOD
-- -----------------------------------------------------
DROP TABLE IF EXISTS FactExchangeRateEOD ;


CREATE TABLE FactExchangeRateEOD (
  ExchangeRateID INT NOT NULL,
  CurrencyKey INT NULL,
  DateKey INT NULL,
  ExchangeRateAUD FLOAT NULL ,-- 'Could not find source for USD exchange rates',
  MarketName VARCHAR(10) NULL,
  PRIMARY KEY (ExchangeRateID))



